import React from 'react'

import allblog from '../blogdata/blog.json'

const AllPosts = () => {
    console.log(allblog)
    return (
        <div>
            {
                allblog.map((items,i) => {

                    {items.blogTitle}
                        <img src={items.blogImage} alt="" srcset="" />

                })
            }
        </div>
    )
}

export default AllPosts
